/* ==UserStyle==
@name         Voz.vn Dark Mode
@version      20210907.08.53
@namespace    userstyles.world/user/nguyentdat27
@description  Dark mode for voz.vn forum
@author       nguyentdat27
@license      No License
==/UserStyle== */
@-moz-document domain("voz.vn") {

    @import url('https://fonts.googleapis.com/css2?family=Plus+Jakarta+Sans&family=Quicksand:wght@500&display=swap');
  /*  @font-face{font-family: VeraSeBd; src: url("https://mdn.github.io/css-examples/web-fonts/VeraSeBd.ttf");}

/**********ccs thread***************/
     /*style binh chon*/
    .iconic-label{
        color:red;
    }
    i{
        color: #f70;
    }
    .iconic--radio.iconic{
        color: pink;
    }
    .p-nav-smallLogo{
        background:#f70;
    }
    /*thanh lat trang*/
    .block-outer-main{
        position: static;/*static*/

        z-index:0;/*0 de hien watch*/
    }
    /**khung trich dan comment**/
    .bbCodeBlock-expandLink{
        background: #0000;
    }
    .bbCodeBlock-expandContent{
        color: yellow;
        font-style: italic;
    }
    /**********************/
    .bbWrapper {
        color: gray;
        font-size: 20px;
        font-family: 'Quicksand', sans-serif;
        background:#222222;

    }

    .message-cell{
        background:#222222;
        border: 0px solid orange;

    }
    .fr-top.fr-basic.fr-ltr.bbWrapper.fr-box {
        background: #444444;
    }

    .fr-view.fr-element > p {
        color: #ffff00;
    }

    .message-inner > .message-cell--user.message-cell > .message-user > .message-userDetails > .message-userTitle.userTitle {
        color: red;
    }
    .message-user{
        border: 0.01px solid grey;
    }

    .message-inner > .message-cell--user.message-cell > .message-user > .message-userDetails > .joindate.message-userTitle {
        color: orange;
    }

    .message-inner > .message-cell--main.message-cell > .js-quickEditTarget.message-main > .js-messageContent.message-content > .message-signature > .bbWrapper {
        font-size: 12px;
    }

    .is-unread.menu-row--clickable.menu-row--separated.menu-row.js-alert.alert {
        background: #333333;
    }

    .forum_view {
        background: #333333;
    }

    .u-jsOnly.inputGroup--joined.inputGroup > .inputGroup-text {
        background: #333333;
    }

    .actionBar-action {
        background: #333333;
    }

    .message-inner {
        background: #333333;
        border: 0.1px solid orange;
    }

    .message-cell--user.message-cell {
        background: #333333;
    }

    .js-expandWatch.bbCodeBlock--quote.bbCodeBlock--expandable.bbCodeBlock {
        background: #333333;
        border: 0.01px solid grey;
    }

    .is-active.js-reactionsList.reactionsBar {
        background: #444444;
    }

    .message-inner > .message-cell--main.message-cell > .js-quickEditTarget.message-main > .js-messageContent.message-content > .js-lbContainer.lbContainer.message-userContent > .js-selectToQuote.message-body > .bbWrapper > .js-expandWatch.bbCodeBlock--quote.bbCodeBlock--expandable.bbCodeBlock > .bbCodeBlock-title {
        background: #333333;
    }

    /*css home*/
    /**info member at home**/
    .memberProfileBanner{
        background:#444444;
    }
    .memberTooltip-nameWrapper{
        color:orange;
    }
    .preview-tooltip {
        background: #333333;
    }

    .block-container {
        background: #333333;
    }

    .block-filterBar {
        background: #333333;
    }

    .menu-content > .menu-footer--split.menu-footer {
        background: gray;
    }

    .u-dt {
        color: #ffffff;
    }

    .menu-content {
        background: #333333;
    }
    /*thông báo*/
    .is-unread.block-row--separated.block-row.js-alert.alert{
        background:#333333;
    }
    /*info trang user*/
    .memberHeader-mainContent{
        background: #333333;
        color:yellow;
    }
    .username{
        color:orange;
    }
    .message-responseRow{
        background:#444444;
    }
    .comment-inner{
        background:#222222;

    }
    /*********************************/
    .node-body{
        border-left:0.1px solid orange;
        border-right:0.1px solid orange;
    }
    .contentRow{
        border:0.1px solid orange;
        background: #444444;
    }
    /*font&link style*/

    a {
        color: #ffff00;
    }

    .node-body > .js-nodeMain.node-main > .node-meta > .node-statsMeta > dl.pairs--inline.pairs > dd {
        color: #ffffff;
    }

    .structItem-cell--main.structItem-cell > .structItem-title {
        font-size: 18px;
    }

    .link--external {
        color: #ffffff;
    }

    mark {
        background-color: #ff0;
        color: #000;
    }

    html {
        color: #d1d1d1;
        background-color: #222222;

    }

    a:hover {
        color: #80c8ff;
    }

    a.tabs-tab.is-active {
        color: #48cfff !important;
        border-color: #41bde9 !important;
    }
}

